import React from 'react'
import { useSelector,} from "react-redux";


function HomePage() {
	const user = useSelector((state) => state.users.u)
	return (
		<div>
			<h1>This is Home page</h1>
			<p>Hello {user.username}</p>
		</div>
	)
}

export default HomePage
